import React from "react";
import CartItem from "./CartItem";

export default ({ value }) => {
  const { cart } = value;
  console.log(value);
  return (
    <div className="container-fluid">
      {cart.map(item => {
        if (item.count !== 0) {
          return <CartItem key={item.id} item={item} value={value} />;
        } else {
          return null;
        }
      })}
    </div>
  );
};
